          "dagInfo": "{\"description\":\"INSERT\\nINTO\\n    TABLE etl_raw_non_coverage_adjustment_factor partition\\n    (\\n        micro_batch_number=11\\n    )\\nSELECT\\n    result.nielsen_campaign_id,\\n    result.mv_tree_id,\\n    result.demographic_id,\\n    result.device_type_code,\\n    result.reportable_geography_code,\\n    result.adjustment_factor,\\n    result.adjustment_factor_type_code,\\n    result.tree_category_type_code,\\n    result.collection_start_date,\\n    115899                    load_id,\\n    from_unixtime(unix_timestamp()) creation_datetime\\nFROM\\n    (\\n        SELECT\\n            main.nielsen_campaign_id,\\n            main.mv_tree_id,\\n            COALESCE(tree.demographic_id,def.demographic_id)     demographic_id,\\n            COALESCE(tree.device_type_code,def.device_type_code) device_type_code,\\n            main.reportable_geography_code,\\n            CASE\\n                WHEN tree.tree_category_type_code IS NOT NULL\\n                THEN tree.adjustment_factor\\n                ELSE def.adjustment_factor\\n            END                                                                AS adjustment_factor,\\n            COALESCE(tree.adjustment_factor_type_code,def.adjustment_factor_type_code) AS\\n            adjustment_factor_type_code,\\n            COALESCE(tree.tree_category_type_code,def.tree_category_type_code) AS\\n            tree_category_type_code,\\n            main.collection_start_date,\\n            def.start_date  AS start_date_def,\\n            def.end_date    AS end_date_def,\\n            tree.start_date AS start_date_tree,\\n            tree.end_date   AS end_date_tree\\n        FROM\\n            (\\n                SELECT DISTINCT\\n                    c.nielsen_campaign_id,\\n                    c.campaign_status_type_code,\\n                    c.collection_start_date,\\n                    c.collection_end_date,\\n                    c.campaign_end_date,\\n                    rcc.reportable_geography_code,\\n                    cc.geography_code,\\n                    mac.sub_category_id,\\n                    mac.category_id,\\n                    ad.adnetwork_id mv_tree_id,\\n                    mac.app_id\\n                FROM\\n                    campaign c\\n                JOIN\\n                    (\\n                        SELECT\\n                            *\\n                        FROM\\n                            etl_driver\\n                        WHERE\\n                            micro_batch_number=11 ) ed\\n                ON\\n                    (\\n                        c.nielsen_campaign_id = ed.level_1_id)\\n                JOIN\\n                    campaign_country cc\\n                ON\\n                    (\\n                        cc.nielsen_campaign_id = c.nielsen_campaign_id\\n                    AND c.released_for_processing_flag = 'Y'\\n                    AND cc.released_for_processing_flag = 'Y'\\n                    AND cc.mobile_ocr_flag = 'Y')\\n                JOIN\\n                    campaign_adnetwork ad\\n                ON\\n                    (\\n                        c.nielsen_campaign_id = ad.nielsen_campaign_id\\n                    AND ad.released_for_processing_flag = 'Y')\\n                JOIN\\n                    etl_device_shared_adjusted_provider_data_distinct_sites eds\\n                ON\\n                    (\\n                        eds.nielsen_campaign_id = ad.nielsen_campaign_id\\n                    AND eds.internet_media_credit_id = ad.adnetwork_id\\n                    AND eds.micro_batch_number = 11)\\n                JOIN\\n                    reportable_geography_to_geography rcc\\n                ON\\n                    (\\n                        rcc.released_for_processing_flag = 'Y'\\n                    AND cc.geography_code = rcc.geography_code)\\n                LEFT OUTER JOIN\\n                    mobile_app_to_app_category mac\\n                ON\\n                    (\\n                        mac.app_id = ad.adnetwork_id\\n                    AND mac.released_for_processing_flag = 'Y')\\n                WHERE\\n                    c.collection_start_date IS NOT NULL\\n                AND c.released_for_processing_flag = 'Y'\\n                AND ed.mobile_processing_flag = 'Y'\\n                AND mac.category_id IS NOT NULL\\n                AND (\\n                        ed.data_date BETWEEN mac.effective_start_date AND mac.effective_end_date\\n                    OR  mac.app_id IS NULL )) main\\n        LEFT OUTER JOIN\\n            (\\n                SELECT\\n                    f.demographic_id,\\n                    f.adjustment_factor,\\n                    adjustment_factor_type_code,\\n                    tree_category_type_code,\\n                    rm.reportable_geography_code geography_code,\\n                    device_type_code,\\n                    start_date,\\n                    end_date\\n                FROM\\n                    coverage_adjustment_factor f\\n                JOIN\\n                    reportable_geography_to_market rm\\n                ON\\n                    (\\n                        f.market_id = rm.market_id\\n                    AND rm.released_for_processing_flag= 'Y')\\n                WHERE\\n                    f.source_key_attribute_id = 0\\n                AND f.adjustment_factor_type_code = 5\\n                AND f.tree_category_type_code = 'A'\\n                AND f.released_for_processing_flag= 'Y' ) def\\n        ON\\n            (\\n                main.reportable_geography_code = def.geography_code)\\n        LEFT OUTER JOIN\\n            (\\n                SELECT\\n                    f.source_key_attribute_id,\\n                    f.demographic_id,\\n                    f.adjustment_factor,\\n                    adjustment_factor_type_code,\\n                    tree_category_type_code,\\n                    rm.reportable_geography_code geography_code,\\n                    f.device_type_code,\\n                    start_date,\\n                    end_date\\n                FROM\\n                    coverage_adjustment_factor f\\n                JOIN\\n                    reportable_geography_to_market rm\\n                ON\\n                    (\\n                        f.market_id = rm.market_id\\n                    AND rm.released_for_processing_flag= 'Y')\\n                WHERE\\n                    f.adjustment_factor_type_code = 5\\n                AND f.source_key_attribute_id <> 0\\n                AND f.tree_category_type_code = 'A'\\n                AND f.released_for_processing_flag='Y') tree\\n        ON\\n            (\\n                tree.source_key_attribute_id = main.category_id\\n            AND main.reportable_geography_code = tree.geography_code\\n            AND def.demographic_id = tree.demographic_id\\n            AND def.device_type_code = tree.device_type_code ) ) result\\nWHERE\\n    (\\n        result.collection_start_date BETWEEN result.start_date_def AND result.end_date_def\\n    OR  result.start_date_def IS NULL)\\nAND (\\n        result.collection_start_date BETWEEN result.start_date_tree AND result.end_date_tree\\n    OR  result.start_date_tree IS NULL)\",\"context\":\"Hive\"}",
